        //show blank to select price
        //show blank to select capacity
        //show blank to select price

        <Fragment>
            <h1>add</h1>
            <form>
                <label>from_loc</label>
                <input type="text" name="from_loc" />
                <label>from_time</label>
                <input type="time_stamp" name="from_time" />
                <label>to_loc</label>
                <input type="text" name="to_loc" />
                <label>to_time</label>
                <input type="time_stamp" name="to_time" />
                <label>capacity</label>
                <input type="number" name="capacity" />
                <label>price</label>
                <input type="number" name="price" />

                <button type="submit">add</button>
            </form>
        </Fragment>
    )
}
